import './App.css';
import {BrowserRouter, Route, Routes} from "react-router-dom";

import Header from "./components/Header/header";
import Navbar from "./components/Navbar/nav-bar";
import Profile from "./components/Tools/Profile/profile";
import Dialogs from "./components/Tools/Dialogs/Dialogs";
import Music from "./components/Tools/Music/Music";
import Settings from "./components/Tools/Settings/Settings";
import News from "./components/Tools/News/News";
import Friend from "./components/Tools/Dialogs/Friends/Friend/Friend";
import Messages from "./components/Tools/Dialogs/Friends/Friend/Messages/Messages";
import Friends from "./components/Tools/Dialogs/Friends/Friends";

function App() {
    return (
        <BrowserRouter>
            <div className="container">
                <Header/>
                <Navbar/>
                <div className="container-content">
                    <Routes>
                        <Route path="/profile" element={<Profile />}/>
                        <Route path="/messages" element={<Dialogs />}/>
                        <Route path="/music" element={<Music />}/>
                        <Route path="/settings" element={<Settings />}/>
                        <Route path="/news" element={<News />}/>
                    </Routes>
                </div>
                <div className={"container-content"}>
                    <Friends/>
                    <Routes>
                        <Route path="/messages/1" element={<Messages/>}/>
                    </Routes>
                </div>
            </div>
        </BrowserRouter>
    );
}

export default App;
